import { Component } from 'react';

export default function Navbar() {
    return (
        <nav className="navbar navbar-light bg-light">
  <div className="container-fluid">
    <span className="navbar-brand mb-0 h1">CLASS HUB</span>
    <div className="d-grid gap-2 d-md-flex justify-content-md-end">
      <button className="btn btn-primary me-md-2" type="button" data-bs-toggle="modal" data-bs-target="#loginPopup">LOGIN</button>
      <button className="btn btn-primary" type="button" data-bs-toggle="modal" data-bs-target="#registerPopup">REGISTER</button>
    </div>
  </div>
</nav>

    
    )

}
